    false,nt"url": null,nt"notes": "The imagery posted on this site is of the
    Gulf Coast of Louisiana, Mississippi and Alabama after Hurricane Katrina made landfall.
    The regions photographed range from Grand Isle, Louisiana to Gulf Shores, Alabama.
    The aerial photograph missions were conducted by the NOAA Remote Sensing Division
    the day after Katrina made landfall, August 30 and concluded September 9. The images
    were acquired from an altitude of 7,500 feet, using an Emerge/Applanix Digital Sensor
    System (DSS). Over 7000 aerial images were obtained during this time period, with
    most available to view online and download.",nt"license_title": null,nt"extras":
